import React from 'react';
import '../Styles/SiderBar.css';

const Sidebar = () => {
  return (
    <div className="sidebar">
      <h2 className="sidebar-title">TSGSystemGestion</h2>
      <ul className="sidebar-menu">
        <li className="menu-item">
          Catalogos
          <ul className="submenu">
            <li>Marcas</li>
            <li>Rubros</li>
            <li>Medidas</li>
            <li>Monedas</li>
            <li>Localidades</li>
          </ul>
        </li>
        <li className="menu-item">Clientes</li>
        <li className="menu-item">Proveedores</li>
        <li className="menu-item">Compras</li>
        <li className="menu-item">Ventas</li>
        <li className="menu-item">Stock</li>
        <li className="menu-item logout">Cerrar Sesion</li>
      </ul>
    </div>
  );
};

export default Sidebar;
